import styles from './List.module.scss';

const List = () => {
  return (
    <div>
      <header>
        <p>
          Things to do <span>soon</span>
        </p>
      </header>
      <p>Interesting things I want to check out</p>
      <section>
        <article>
          <h2>Books</h2>
        </article>
        <article>
          <h2>Movies</h2>
        </article>
        <article>
          <h2>Games</h2>
        </article>
      </section>
    </div>
  );
};

export default List;
